import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { AdminCreate } from './interfaces';

@Injectable({
  providedIn: 'root'
})
export class AdminService {

  private apiUrl = 'http://localhost:000/admin';

  constructor(private http: HttpClient) {}

  getAdmins(): Observable<AdminCreate[]> {
    return this.http.get<AdminCreate[]>(this.apiUrl);
  }

  createAdmin(admin: AdminCreate): Observable<AdminCreate> {
    return this.http.post<AdminCreate>(this.apiUrl, admin);
  }
}
